window.bookSummaryJSON = "<p><b>Only one woman can stop the world from descending into endless war, in the thrilling new series in the world of the Gas-Lit Empire</b> </p> <p>The year is 2012. The nations of the world are bound together in an alliance of collective security, overseen by the International Patent Office and its ruthless stranglehold on technology. </p> <p>When airships start disappearing in the middle of the Atlantic, the Patent Office is desperate to discover what has happened. Forbidden to operate beyond the territorial waters of member nations, they send spies to investigate in secret. </p> <p>One of those spies is Elizabeth Barnabus. She must overcome her dislike of the controlling Patent Office, disguise herself as a man, and take to the sea in search of the floating nation of pirates who threaten the world order. </p>"; 
